import React, { useRef, useState } from 'react';
import './Algorithm.css';
import Section from '../common/Section';
import Button from '../common/Button';

const Algorithm = () => {
  const [isDragging, setIsDragging] = useState(false);
  const [startX, setStartX] = useState(0);
  const [currentTranslate, setCurrentTranslate] = useState(0);
  const containerRef = useRef(null);
  
  // Sample algorithm steps data
  const algorithmSteps = [
    {
      id: 1,
      title: "Создаст персональное резюме",
    },
    {
      id: 2,
      title: "Выделит ваши сильные стороны",
    },
    {
      id: 3,
      title: "Привлечет работодателей уже через несколько часов",
    }
  ];

  const handleMouseDown = (e) => {
    setIsDragging(true);
    setStartX(e.pageX);
    if (containerRef.current) {
      // Stop the animation immediately
      containerRef.current.style.animationPlayState = 'paused';
      
      // Get current translation from computed style
      const computedStyle = window.getComputedStyle(containerRef.current);
      const matrix = new WebKitCSSMatrix(computedStyle.transform);
      setCurrentTranslate(matrix.m41); // m41 is the translateX value
    }
  };

  const handleTouchStart = (e) => {
    e.preventDefault(); // Prevent scrolling while dragging
    setIsDragging(true);
    setStartX(e.touches[0].pageX);
    if (containerRef.current) {
      containerRef.current.style.animationPlayState = 'paused';
      
      const computedStyle = window.getComputedStyle(containerRef.current);
      const matrix = new WebKitCSSMatrix(computedStyle.transform);
      setCurrentTranslate(matrix.m41);
    }
  };

  const handleMouseMove = (e) => {
    if (!isDragging) return;
    e.preventDefault();
    
    const currentX = e.pageX;
    const diff = currentX - startX;
    
    if (containerRef.current) {
      containerRef.current.style.transform = `translateX(${currentTranslate + diff}px)`;
    }
  };

  const handleTouchMove = (e) => {
    if (!isDragging) return;
    e.preventDefault();
    
    const currentX = e.touches[0].pageX;
    const diff = currentX - startX;
    
    if (containerRef.current) {
      containerRef.current.style.transform = `translateX(${currentTranslate + diff}px)`;
    }
  };

  const handleMouseUp = (e) => {
    if (!isDragging) return;
    setIsDragging(false);
    
    if (containerRef.current) {
      // Store the current position
      const finalTranslate = currentTranslate + (e.pageX - startX);
      
      // Reset to CSS animation with a transition
      containerRef.current.style.transition = 'none';
      containerRef.current.style.transform = '';
      containerRef.current.style.animationPlayState = 'running';
      
      // Force a reflow to apply changes
      containerRef.current.offsetHeight;
      
      // Remove the transition after it's done
      setTimeout(() => {
        if (containerRef.current) {
          containerRef.current.style.transition = '';
        }
      }, 50);
    }
  };

  const handleMouseLeave = (e) => {
    if (isDragging) {
      handleMouseUp(e);
    }
  };

  return (
    <section className="algorithm-container">
      <div className="container">
        <h3 className="section-title accent">Алгоритм обучен профессиональными рекрутерами и HR</h3>
      </div>
      
      <div className="cards-flex"
           onMouseDown={handleMouseDown}
           onMouseMove={handleMouseMove}
           onMouseUp={handleMouseUp}
           onMouseLeave={handleMouseLeave}
           onTouchStart={handleTouchStart}
           onTouchMove={handleTouchMove}
           onTouchEnd={handleMouseUp}>
        <div className={`cards-container ${isDragging ? 'dragging' : ''}`}
             ref={containerRef}>
          {/* First set of cards */}
          {algorithmSteps.map((step) => (
            <div key={`step-${step.id}`} className="algorithm-card">
              <p>{step.title}</p>
              <div className='like'>
                <img src="/img/svg/like.svg" alt="" />
              </div>
            </div>
          ))}
          
          {/* Duplicate set for seamless infinite scrolling */}
          {algorithmSteps.map((step) => (
            <div key={`step-dup-${step.id}`} className="algorithm-card">
              <p>{step.title}</p>
              <div className='like'>
                <img src="/img/svg/like.svg" alt="" />
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Algorithm;
